import React from "react";

function Form() {
    return (
        <div>
            <form>
                <div class="form-group">
                    <label for="address">Address</label>
                    <input type = 'text' class="form-control" id="InputAddress" name = 'user_address' placeholder="Enter Current Address"/>
                    <small id="addressHelp" class="form-text text-muted">We'll never share your address with anyone else.</small>
                 </div>
                 <div class="form-group">
                    <label for="Locations">Location</label>
                    <input type = 'text' class="form-control" id="LocationAddress" name = 'user_location' placeholder="Enter Location Type"/>
                 </div>
                 <button type="submit" class="btn btn-primary">Submit</button>
            </form>
        </div>
    )
}


export default Form;
